  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of a hydrologic
  study to characterize groundwater budgets and water quality in the Diamond Valley
  Flow System (DVFS), central Nevada. This dataset represents the groundwater discharge
  area (GDA) in the DVFS. Vegetated areas within the GDA are composed of phreatophytic
  shrubs with smaller areas of grassland, marshland, xeric vegetation, bare soil,
  and agricultural lands where phreatophytic shrubs historically were present. Vegetated
  areas outside the GDA are primarily composed of xeric vegetation and bare soil although
  very sparse phreatophytic shrubs may be present on the outer margins of the boundary.
  The GDA was mapped in the summer of 2011 using field reconnaissance and supporting
  digital data. Additional supporting field information was gathered in fall of 2014.\",\n\t\"owner_org\":
